import React, {useState} from 'react';
import TextField from '@mui/material/TextField';
function TextChanger(props){
    const handleChange = (event) => {
        props.onValueChange([props.keyHistory, event.target.value]);//This may need optimization. Sends event every keystroke
    }


    return(
        <TextField size="small"sx={{mb: 1, textAlign:"justify"}}defaultValue={props.value} onChange={handleChange}></TextField>
    )
}

export default TextChanger;
